import styled from 'styled-components'

export const StyledDiv = styled.div`
    height: 100vh;
    display: flex; 
    align-items: center; 
    justify-content: center; 
    flex-flow: column;  

    div{
        background: red; 
        width: 500px;
        height: 80px;
        display: flex; 
        justify-content: center;
        align-items: center; 
        margin: 20px;    
    }
`
